function analyze(quizzes, score, week, summary_skip){
  // For each student 
  let all_score_all = []
  for(let i = 0; i < score.length; i++){
    let cur_student = $("#student_container_template").clone()
    cur_student.attr("id", "student_container_" + score[i]["座號："]);
    let cur_score_all = [];
    let cur_score_obj = {'studentName':score[i]["姓名："], 'studentID':score[i]["座號："]}
    // For each answer (in one student response)
    for(let j = 0; j < quizzes.length; j++){
      let cur_score = score[i][quizzes[j]["題目"]][0];      
      if(quizzes[j]["正面負面"] == "negative"){
        cur_score = 6 - cur_score;
      }
      cur_score_obj[quizzes[j]["向度"]] = parseInt(cur_score);
      /*
      // 1st 
      if(cur_score_obj[quizzes[j]["向度"]]==undefined){
        cur_score_obj[quizzes[j]["向度"]] = parseInt(cur_score);
      }
      // two or more
      else{
        cur_score_obj[quizzes[j]["向度"]] = parseInt(cur_score_obj[quizzes[j]["向度"]]) + parseInt(cur_score);  
      }      '
      */
    }   
    // FIX 1 QUIZZES PER FIELD
    for (let i=0; i<labels.length; i++) {
      cur_score_obj[labels[i]] = (cur_score_obj[labels[i]]) 
    }    
    // PUT IN
    for (let i=0; i<labels.length; i++) {
      cur_score_all.push(cur_score_obj[labels[i]])
    }
    if(!summary_skip){
      // Generate Text from score   
      let teacher_review = ""    
      // Generate whole description
      for(let j=0; j<labels.length; j++){
        let review_return;
        review_return = judgeText(cur_score_all[j], labels[j]);
        teacher_review += labels[j] + ":<span class="+ review_return[0] +" data-order='0' data-field="+ labels[j] + ">";
        teacher_review += review_return[1];
        if(j!=labels.length-1){
          teacher_review += "</span>，";
        }
        else{
          teacher_review += "</span>。";
        }
      } 
      cur_student.find(".review").html(teacher_review);
      
      // Edit A4
      cur_student.find(".student_id").text(score[i]["姓名："]);
      cur_student.find(".student_id2").text(score[i]["姓名："]);
      cur_student.find(".chart_container canvas").attr("id", "canvas_" + score[i]["座號："]);
      cur_student.appendTo($("#students_container")); 
      // Canvas Radar
      drawChart(score[i]["座號："], cur_score_all)
      cur_student.find(".a4-chart").show();
    }    
    all_score_all.push(cur_score_obj);
  }
  // Success  
  if(!summary_skip){
    toggleReviewChange();
    $("#execution-msg").show();
    $("#execution-msg").html('順利產生 <span id="execution-msg-event"></span> 成功! 上面有本次成績單，下面有本次題目檢視。<br/><a href="#main-body" title="To Top">點我往上<i class="fas fa-angle-up fa-2x"></i></a>');
    if (week==0){
      $("#execution-msg-event").text('老師他評');
    }
    else if(week==1){
      $("#execution-msg-event").text('學生自評1');
    }
    else if(week==2){
      $("#execution-msg-event").text('學生自評2');
    }
    else if(week==3){
      $("#execution-msg-event").text('學生自評3');
    }
    else if(week==4){
      $("#execution-msg-event").text('學生自評4');
    }    
  }
  return all_score_all;
}
