function analyzeInitial(){
  labels = [];
  labelSet = new Set();
  $("#execution-msg").hide();
  $("#students_container").children().remove();
  $(".quiz-preview-area").children().remove();
}
function calculateWeek(week_number, summary_skip=false){  
  ClickMEE2 = week_number;
  analyzeInitial();
  let quizzes_text, quizzes, score_text, score;
  try{
    quizzes_text = document.getElementById("week"+String(week_number)+"_quiz").value;
    quizzes = JSON.parse(quizzes_text);
    //quizzes = csv2json(quizzes_text);   
    score_text = document.getElementById("week"+String(week_number)+"_score").value;
    score = JSON.parse(score_text);
    //score = csv2json(score_text);
  }
  catch(SyntaxError){     
    $("#execution-msg").show();
    $("#execution-msg").text('發生錯誤，請檢查上方文字框資訊填入資訊格式正確')
    console.log('err in function calculateWeek()')
    return;
  }
  quizAnalyze(quizzes);
  let all_score_all;
  all_score_all = analyze(quizzes, score, week_number, summary_skip);
  return all_score_all;
}
function saveWeb(){
  localStorage.removeItem('psyAnalyzeSave');
  let psyAnalyzeSave = {"ClickMEE1": ClickMEE1, "ClickMEE2": ClickMEE2};
  let saveReview = []
  $("#students_container").children().each(function() {
    saveReview.push($(this).find(".review").html())
  });
  psyAnalyzeSave['saveReview'] = saveReview;
  localStorage.setItem('psyAnalyzeSave', JSON.stringify(psyAnalyzeSave));

  //Success
  let successText;
  if(ClickMEE2=='5'){
    successText = '綜合'
  }
  else if(ClickMEE2=='0'){    
    successText = '老師'
  }
  else{    
    successText = '學生' + ClickMEE2;
  }
  $("#execution-msg").show();  
  $("#execution-msg").text('存檔成功! 班級:40'+ClickMEE1+" 成績單:"+successText);
}
function loadWeb(){
  try{
    const psyAnalyzeSave = JSON.parse(localStorage.getItem('psyAnalyzeSave'))
    inputText(psyAnalyzeSave['ClickMEE1']);
    if (psyAnalyzeSave['ClickMEE2'] == '5'){
      analyzeSummary();
    }else{
      calculateWeek(psyAnalyzeSave['ClickMEE2']);
    }
    $("#students_container").children().each(function(index) {    
      $(this).find(".review").html(psyAnalyzeSave['saveReview'][index]);
    });
  }
  catch(error){
    console.log(error, 'err in function loadWeb()')
    $("#execution-msg").show();  
    $("#execution-msg").text('讀檔失敗');
    return;
  }  
  //Success
  toggleReviewChange();
  let successText;
  if(ClickMEE2=='5'){
    successText = '綜合'
  }
  else if(ClickMEE2=='0'){    
    successText = '老師'
  }
  else{    
    successText = '學生' + ClickMEE2;
  }
  $("#execution-msg").show();  
  $("#execution-msg").html('讀檔成功! 班級:40'+ClickMEE1+" 成績單:"+successText+'<br/><a href="#main-body" title="To Top">點我往上<i class="fas fa-angle-up fa-2x"></i></a>');
}
